import React from "react";
import { Switch, Route, Redirect, useHistory } from "react-router-dom";

function Main({ name }) {
  let history = useHistory();
  const years = ["2016", "2015", "2014", "2013", "2012", "2011"];
  return (
    <div>
      <h2>{name}</h2>
      <ul>
        {years.map((item) => {
          return (
            <li onClick={() => history.push(`/${item}`)}>
              <a href="">{item}</a>
            </li>
          );
        })}
      </ul>
      <Switch>
        <Route path="/horror">
          <Main name="horror" />
        </Route>
        <Route path="/series">
          <Main name="series" />
        </Route>
        <Route path="/fantastic">
          <Main name="fantastic" />
        </Route>
        <Redirect from="" to="" />
      </Switch>
    </div>
  );
}

export default Main;
